import "./App.css";

function App() {
  return (
    <section className="container">
      <h2>About Me</h2>
      <img
        src="/images/profile_photo.jpg"
        alt="Profile Picture"
        className="profile-pic"
      />
      <div>
        <p></p>
        <p> My specialties include a multitude of approaches and platforms
        to solve programming tasks. I bring a unique and innovated style when
        developing existing projects. Thriving in a fast-paced environment where
        there are frequent challenges is what motivates me as a developer. I am
        also eager to seize new opportunities and responsibilities. I work well
        independently and in collaboration with others.</p>
      </div>
    </section>
  );
}

export default App;
